import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';


//Setup Vars
const data = [
    {
        img: 'https://www.slashfilm.com/wp/wp-content/images/terminator-6-direction.jpg',
        title: 'Terminator',
        author: 'James Cameron',
    },
    {
        img: 'https://www.slashfilm.com/wp/wp-content/images/terminator-6-direction.jpg',
        title: 'James Brown',
        author: 'Mad Dog',
    },

];



function BookList() {
    return (
        <>
            <section className='booklist'>

                {data.map((book) => {
                    const { img, title, author } = book;
                    return <Book book={book}></Book>;
                })}

            </section>
        </>
    )
}



const Book = (props) => {
    return (
        <article>
            <img src={props.book} alt='' />
            <h1>{props.book}</h1>
            <h1> {props.bookr}</h1>
        </article>

    )
}


ReactDOM.render(
    <>
        <BookList />

    </>

    ,
    document.getElementById('root')
)
